import React from 'react';
import './MainPage.css';

const MainPage = () => {
  return (
    <div className="app-container">

      {/* Header */}
      <header>
        <h1>Welcome to SUtore</h1>
      </header>

      {/* Title */}
      <section>
        <h2>A technology store for Sabancı students!</h2>
      </section>

      {/* Button */}
      <section className="button-section">
        <button
          className="shopping-button"
          onClick={() => alert("Let's start shopping!")}
        >
          Let's start shopping!
        </button>
      </section>

      {/* Footer */}
      <footer className="footer">
        © 2024 SUtore. All rights reserved.
      </footer>

    </div>
  );
};

export default MainPage;
